import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { AreaChart, Area, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';
import axios from 'axios';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [tokenData, setTokenData] = useState([]);
  const [selectedTokenIndex, setSelectedTokenIndex] = useState(0);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const res = await axios.get('https://profitpilot-backend.onrender.com/api/user/profile', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        setUser(res.data);
        setTokenData(res.data.tokens || []);
      } catch (err) {
        console.error(err);
      }
    };
    fetchUser();
  }, []);

  const countdownStart = new Date('2025-06-06T00:00:00Z');
  const [now, setNow] = useState(new Date());
  useEffect(() => {
    const interval = setInterval(() => setNow(new Date()), 1000);
    return () => clearInterval(interval);
  }, []);

  const remaining = countdownStart - now;
  const hours = Math.floor((remaining / (1000 * 60 * 60)) % 24);
  const minutes = Math.floor((remaining / (1000 * 60)) % 60);
  const seconds = Math.floor((remaining / 1000) % 60);

  const chartData = tokenData[selectedTokenIndex]?.performance || [];

  return (
    <div className="text-white space-y-6">
      <div className="bg-[#1a1a1a] p-6 rounded-xl shadow-md">
        <h2 className="text-xl font-semibold text-orange-500 mb-2">Welcome, {user?.username}</h2>
        <p className="text-lg">
          Balance: <span className="text-green-400 font-bold">${user?.balance?.toFixed(2) || '0.00'}</span>
        </p>
        <p className="text-sm mt-1">
          Mining Rate: <span className="text-orange-400 font-semibold">${user?.miningRate || '0.70'}</span> / 2hrs
        </p>
        <p className="text-xs text-gray-400 mt-1">
          Next withdrawal countdown starts in: {remaining > 0 ? `${hours}h ${minutes}m ${seconds}s` : 'Started'}
        </p>
        <Link to="/boost">
          <button className="mt-4 bg-orange-600 hover:bg-orange-700 px-4 py-2 rounded-lg text-white font-semibold">
            Boost Now
          </button>
        </Link>
      </div>

      <div className="bg-[#1a1a1a] p-6 rounded-xl shadow-md">
        <div className="flex justify-between items-center mb-4">
          <h3 className="text-lg font-semibold text-orange-500">Token Performance</h3>
          {tokenData.length > 1 && (
            <select
              value={selectedTokenIndex}
              onChange={(e) => setSelectedTokenIndex(Number(e.target.value))}
              className="bg-black text-white border border-orange-500 rounded p-1"
            >
              {tokenData.map((token, index) => (
                <option key={index} value={index}>
                  {token.name || `Token ${index + 1}`}
                </option>
              ))}
            </select>
          )}
        </div>
        <ResponsiveContainer width="100%" height={250}>
          <AreaChart data={chartData}>
            <XAxis dataKey="time" stroke="#8884d8" />
            <YAxis stroke="#8884d8" />
            <Tooltip />
            <Area type="monotone" dataKey="value" stroke="#ff6a00" fill="#ff6a00" />
          </AreaChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

export default Dashboard;
